import React from "react";
import Home from "./Components/Home";
import { Routes, Route } from "react-router-dom";
import App1 from "./App1";

const App = () => {
  return (
    <div>
      {/* <Home /> */}
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/add" element={<App1 />}></Route>
      </Routes>
    </div>
  );
};

export default App;
